SELECT COUNT(DISTINCT customer_id)
FROM banking_new."Customers"
WHERE email ~* '@yahoo.com';

SELECT COUNT(DISTINCT c1.customer_id) AS duplicate_customers
FROM banking_new."Customers" c1
JOIN banking_new."Customers" c2 ON c1.customer_name = c2.customer_name AND c1.date_of_birth = c2.date_of_birth AND c1.customer_id < c2.customer_id;

SELECT COUNT(*) AS transaction_count
FROM banking_new."Transactions"
WHERE "Transactions".account_id = 128;

SELECT COUNT(*) 
FROM banking_new."Loans" 
WHERE EXTRACT(YEAR FROM start_date) < 2024;
